import styled from "styled-components";

const Header = styled.div`
    font-size: 1.5em;
    text-align: center;
`

function HeaderComponent(props) {
    return (
        <Header as = {props.tag ? props.tag : "h1"}>{props.text}</Header>
    );
}

export default HeaderComponent;
